  \"2013-03-15T14:32:45.048365\",\n\t\"name\": \"geologicsurficial-landforms\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This is a raster (cell-based) dataset depicting
  landforms in Vermont. Cells are 30 meters. Landforms are topographic units of landscapes
  that often occur in characteristic combinations and configurations. Eighteen separate
  landforms (e.g., upper side slope, wetland, cove or draw) are defined for Vermont.
  They were derived from 30m USGS digital elevation models following a technique described
  by Fels and Matson (1997); see \"Supplemental.\"\",\n\t\"license_title\": null,\n\t\"extras\":
